import React, {Component} from 'react';
import './App.css';

class App extends Component {
  state = {
    data: [
      {name: 'test', gender: 1, weight: 70, height: 175, bmi: 24.2},
      {name: 'testt', gender: 2, weight: 7, height: 75, bmi: 34.2}
    ]
  }

  render(){
    return (
      <div className="App">

      </div>
    );
  }

}

export default App;
